import React from "react";
import './style.css'
import bandAid from '../band-aid.svg'
import {
    Switch,
    Route,
    Link,
    Redirect
} from 'react-router-dom';

function Header() {
    return (
        <div id='header'>
            <img src={bandAid} alt='Пикчи нет' className='bandAid'></img>
            <Route path="/login">
                        <p>Войти в систему</p>
                    </Route>
            <h1>Зарегестрироваться в системе</h1>
        </div>
    )
}

export default Header
